from typing import List
import time
start = time.time()

class Solution:
    def __init__(self) -> None:
        self.out = []

    def part_of_arr(self, arr: List[int], k: int, x: int) -> List[int]:
        middle = len(arr) // 2
        if middle > 2 * k:
            if arr[middle] > x:
                arr = arr[:middle + k + 1]
            else:
                arr = arr[middle - k:]
            arr = self.part_of_arr(arr, k, x)
        return arr

    def findClosestElements(self, arr: List[int], k: int, x: int) -> List[int]:
        closest_arr = self.part_of_arr(arr, k, x)
        ai = len(closest_arr)//2
        a = closest_arr[ai]
        if len(closest_arr) == k:
            return closest_arr
        for i,b in enumerate(closest_arr):
            if a == b:
                continue
            if not(abs(a-x) < abs(b-x) or (abs(a-x) == abs(b-x) and a < b)):
                a = b
                ai = i
        else:
            closest_arr.remove(a)
            self.out.append(a)

        counter = 1
        while counter < k:
            if ai >= len(closest_arr) - 1:
                ai = len(closest_arr) - 1
                a = closest_arr[ai] 
                b = closest_arr[ai - 1]
            elif ai < 1:
                ai = 1
                a = closest_arr[ai] 
                b = closest_arr[ai - 1]
            else:
                a = closest_arr[ai] 
                b = closest_arr[ai - 1]
            if a == b:
                counter += 1
                closest_arr.remove(a)
                self.out.append(a)
                continue
            elif not (abs(a-x) < abs(b-x) or (abs(a-x) == abs(b-x) and a < b)):
                a = b
                counter += 1
                closest_arr.remove(a)
                self.out.append(a)
                ai -= 1
                continue
            else:
                counter += 1
                closest_arr.remove(a)
                self.out.append(a)
                continue
        return sorted(self.out)
  
